import React from 'react';

// Wrapping the component with React.forwardRef to allow printing
const PrintableContent = React.forwardRef((props, ref) => (
  <div ref={ref}>
    <h1>Electronics Content</h1>
    <p>{props.response}</p>
  </div>
));

export default PrintableContent;
